import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Title from './src/Title';
import Desc from './src/Desc';
import BasicButtons from './src/Buttton';

import axios from 'axios';




export default function SimplePaper() {
  const [state, setState] = React.useState([])
  const [hasError, setHasError] = React.useState(false)

  React.useEffect(async () => {
    await axios.post("http://localhost:8080/api", {
    headers: {
      "Content-Type": `application/json`,
    }}
      ).then(res => console.log(res)).catch(err => setHasError(true))}, []);
  const onSubmit = (data) => {
    alert(JSON.stringify(data));
  };
  return (
    <form onSubmit={onSubmit}>
      <Paper elevation={3} 
        sx={{
          display: 'flex',
          flexBasise: 0,
          flexDirection: 'row',
          justifyContent: 'flex-start',
          alignItems: 'center',
          hight: '100vh'

        }}
      >
        <Box sx={{
          m: 1, 
          display: 'flex',
          flexDirection: 'column',
          margin: 2,
          justifyContent:'flex-start',
          flexGrow: 3
          }}>
        <Box sx={{mb: 2}}>
      <TextField id="outlined-basic" name="title" label="Outlined" variant="outlined" sx={{width: '100%'}} />
    </Box>
          <Desc />
          <BasicButtons />
        </Box>
      </Paper>
    </form>
  );
}
